SQL_OUTPUT:
SELECT tbl_studies_info.title, tbl_studies_info.study_details->>'source' AS source
FROM tbl_studies_info
WHERE tbl_studies_info.title = 'Exposure, Dose, Body Burden and Health Effects of Lead';

SELECT si.title, si.study_details->>'treatment' AS treatment
FROM tbl_studies_info si
WHERE si.title = 'Effect of Vibroacoustic Therapy on Acute Stress in University Students';

SELECT si.title, si.study_details ->> 'source' AS study_source
FROM tbl_studies_info si
WHERE si.title = 'Homeopathic Preparation Plumbum Metallicum for Lead Poisoning';

SELECT title, study_details->>'study_type' AS study_type
FROM tbl_studies_info
WHERE title = 'Exposure, Dose, Body Burden and Health Effects of Lead';
